import React from 'react';
import ThanksComp from '../components/contact-us/ContactUsReplyComp';
import Layout from '../components/common/Layout';

const ThankYou = () => (
  <>
    <Layout>
      <ThanksComp />
    </Layout>
  </>
);

export default ThankYou;
